import React from "react";
import Articles from "../../components/articles";
import Layout from "../../components/layout";

const News = ({ articles }) => {
  const categories = articles.reduce((acc, article) => {
    return [...acc, article.category.name];
  }, []);
  return <Layout></Layout>;
};

export default News;

